using System;
using System.Collections.Generic;
using System.Data.OleDb;
using System.IO;
using System.Linq;
using System.Net;
using System.Security.AccessControl;
using System.Security.Principal;
using System.Windows.Forms;

namespace WacVisitor
{
    static class Program
    {
        /// <summary>
        /// The main entry point for the application.
        /// </summary>
        [STAThread]
        static void Main()
        {
            Application.EnableVisualStyles();
            Application.SetCompatibleTextRenderingDefault(false);

            ClassHelper.clsXML clsxmlP = new ClassHelper.clsXML();
            try
            {
                #region Restore config file when it s gone
                FileInfo fi = new FileInfo(@"config.xml");
                if (fi.Length < 200)
                {
                    if (File.Exists(classGlobal.settingFile + @"\config.xml") == true)
                        File.Copy(classGlobal.settingFile + @"\config.xml", @"config.xml", true);
                }
                #endregion

                #region lower key in config.xml 
                string str = File.ReadAllText(classGlobal.config);
                str = str.Replace("License>", "license>");
                str = str.Replace("WebcamDevice>", "webcamdevice>");
                str = str.Replace("BarcodeType>", "barcodetype>");
                str = str.Replace("RandomNumber>", "randomnumber>");
                str = str.Replace("DB>", "db>");
                str = str.Replace("Place>", "place>");
                str = str.Replace("TitleName>", "titlename>");
                str = str.Replace("Watermark>", "watermark>");
                str = str.Replace("EnableStatute>", "enablestatute>");
                File.WriteAllText(@"config.xml", str);
                Console.Write("");
                #endregion
               
                #region ลบ config SVR เพราะ fix ไว้ในโค้ดปลอดภัยกว่า
                if (clsxmlP.CheckExistElement("root", "SVR", classGlobal.config) == true)
                    clsxmlP.RemoveElement("root", "SVR", classGlobal.config);
                #endregion              

                #region postgres database connection information
                if (System.IO.File.Exists(AppDomain.CurrentDomain.BaseDirectory + @"db.xml") == false)
                {
                    clsxmlP.CreateXML(AppDomain.CurrentDomain.BaseDirectory + @"db.xml");
                    clsxmlP.AppendElement("root", "ServerIP", "127.0.0.1", AppDomain.CurrentDomain.BaseDirectory + @"db.xml");
                    clsxmlP.AppendElement("root", "Port", "5432", AppDomain.CurrentDomain.BaseDirectory + @"db.xml");
                    clsxmlP.AppendElement("root", "db", "wacvisitor", AppDomain.CurrentDomain.BaseDirectory + @"db.xml");
                    clsxmlP.AppendElement("root", "User", "postgres", AppDomain.CurrentDomain.BaseDirectory + @"db.xml");
                    clsxmlP.AppendElement("root", "Password", classGlobal.Crypt("password@1"), AppDomain.CurrentDomain.BaseDirectory + @"db.xml");
                }
                #endregion

                #region ลบ key ใน config ที่ไม่ใช้แล้วออก
                if (clsxmlP.CheckExistElement("root", "WSURL", classGlobal.config) == true)
                    clsxmlP.RemoveElement("root", "WSURL", classGlobal.config);
                #endregion

                #region ใช้ X50 หรือไม่
                if (clsxmlP.CheckExistElement("root", "X50", classGlobal.config) == true)
                    clsxmlP.RemoveElement("root", "X50", classGlobal.config);
                if (System.IO.File.Exists(AppDomain.CurrentDomain.BaseDirectory + @"PASSPORT_Engine\X50_Engine.exe"))
                    classGlobal.boolX50 = true;
                #endregion

                #region requirement ของพี่กุ่ย ชื่อ-สกุล/เลขบัตรปชช ในสลิปให้เป็น ##### กับ มี dialog ยืนยันรหัสก่อนเข้าดูรายงาน
                if (clsxmlP.CheckExistElement("root", "hashtaginfo", classGlobal.config) == false)
                    Console.Write("do nothing");  //clsxml.AppendElement("root", "hashtaginfo", "false", classGlobal.config);  // true / false
                else
                    clsxmlP.RemoveElement("root", "hashtaginfo", classGlobal.config);  // ลบ config นี้ออก            
                #endregion

                #region Check exists Npgsql.dll for postgres database connection
                if (System.IO.File.Exists(@"Npgsql.dll") == false)
                {
                    MessageBox.Show("Not found Npgsql.dll");
                    return;
                }
                #endregion

                #region Set logo extension file to png
                FileInfo f;
                if (File.Exists(@"logo.jpg"))
                {
                    f = new FileInfo(@"logo.jpg");
                    f.MoveTo(Path.ChangeExtension(@"logo.jpg", ".png"));
                }
                else if (File.Exists(@"logo.jpeg"))
                {
                    f = new FileInfo(@"logo.jpeg");
                    f.MoveTo(Path.ChangeExtension(@"logo.jpeg", ".png"));
                }
                #endregion

                #region Rename IPCamera Engine folder
                if (System.IO.Directory.Exists(AppDomain.CurrentDomain.BaseDirectory + @"IPCAM"))
                    Directory.Move(AppDomain.CurrentDomain.BaseDirectory + @"IPCAM", AppDomain.CurrentDomain.BaseDirectory + @"IPCAM_Engine");
                #endregion

                #region slip_description
                if (!System.IO.File.Exists(@"slip_description.txt"))
                {
                    if (!System.IO.File.Exists(@"slip_description.txt"))
                    {
                        using (System.IO.StreamWriter file = new System.IO.StreamWriter(@"slip_description.txt"))
                        {
                            file.WriteLine("เก็บบัตรนี้ยื่นให้ รปภ. ตรวจสอบ");
                            file.WriteLine("และบันทึกเวลาออก");
                            file.WriteLine("(บัตรสูญหาย ปรับ 200 บาท)");
                            file.WriteLine("ยินยอมให้บันทึกข้อมูลส่วนบุคคล");
                            file.WriteLine("เพื่อใช้ในการรักษาความปลอดภัยในพื้นที่เท่านั้น");
                        }
                    }
                }
                #endregion

                #region slip_agreement
                if (!System.IO.File.Exists(@"slip_agreement.txt"))
                {
                    using (System.IO.StreamWriter file = new System.IO.StreamWriter(@"slip_agreement.txt"))
                    {
                        file.WriteLine("ท่านได้อ่านและเข้าใจกฏระเบียบว่าด้วยความปลอดภัย");
                    }
                }
                #endregion

                #region Check dotnet framework version from reference "ServicePointManager.SecurityProtocol"
                clsxmlP = new ClassHelper.clsXML();
                string versionCloud = clsxmlP.GetReadXML("root", "db", classGlobal.config).ToString();
                if (!versionCloud.Equals("acc") && !versionCloud.Equals("psql"))
                {
                    string verFW = AppDomain.CurrentDomain.SetupInformation.TargetFrameworkName;
                    if (verFW.Equals(".NETFramework,Version=v4.5"))
                    {
                        ServicePointManager.SecurityProtocol |= SecurityProtocolType.Tls11 | SecurityProtocolType.Tls12;   // dotnet 4.5 
                    }
                    else
                    {
                        ServicePointManager.SecurityProtocol = (SecurityProtocolType)3072;  // dotnet 4.0
                        MessageBox.Show("Please upgrade application to framework 4.5!", verFW, MessageBoxButtons.OK, MessageBoxIcon.Warning);
                        Environment.Exit(0);
                    }
                }
                #endregion

                #region create image icon
                if (File.Exists(AppDomain.CurrentDomain.BaseDirectory + "icon" + @"\" + "appointment.png") == false)
                {
                    string ico_appointment = "";
                    byte[] ico_app = Convert.FromBase64String(ico_appointment);
                    File.WriteAllBytes(AppDomain.CurrentDomain.BaseDirectory + "icon" + @"\" + "appointment.png", ico_app);
                }
                #endregion

                #region Debug Test Or Not
                if (clsxmlP.CheckExistElement("root", "debug", classGlobal.config) == false)
                    clsxmlP.AppendElement("root", "debug", "false", classGlobal.config);

                bool bDebug = bool.Parse(clsxmlP.GetReadXML("root", "debug", classGlobal.config));
                if (bDebug == true)
                    classGlobal.API_URL = "http://10.0.0.205:4004/";
                else
                    classGlobal.API_URL = "https://api.visitors.wacappcloud.com/";
                #endregion

                #region เปิดการใช้เช็คอายุ
                if (clsxmlP.CheckExistElement("root", "checkage", classGlobal.config) == false)
                    clsxmlP.AppendElement("root", "checkage", "false", classGlobal.config);

                string readStr = clsxmlP.GetReadXML("root", "checkage", classGlobal.config).ToLower().ToString();
                if (readStr == "false")
                    classGlobal.CheckAge = 0;
                else if (readStr == "true")
                    classGlobal.CheckAge = 20;
                else
                    classGlobal.CheckAge = Int32.Parse(clsxmlP.GetReadXML("root", "checkage", classGlobal.config));
                #endregion                

                #region GemSmartCardLib
                if (File.Exists(@"GemSmartCardLib.dll") ==false)
                {
                    string baseStrGemLib = ""; //Convert.ToBase64String(gemLib);
                    byte[] gemLib = Convert.FromBase64String(baseStrGemLib);
                    File.WriteAllBytes(@"GemSmartCardLib.dll", gemLib); 
                }
                #endregion

                classGlobal.CHECK_DATABASE_SIZE();
            }
            catch (Exception ex)
            {
                System.Windows.Forms.MessageBox.Show(ex.Message.ToString());    
                Console.Write(ex.Message.ToString()); 
            }
            clsxmlP = null;

            Application.Run(new frmMain());
        }

    }

    
}
